function Library:getRandom(List)
	local Parsed = {}

	for _ in pairs(List) do
	  table.insert(Parsed, _)
	end	
	
	return math.random(1, #Parsed)
end

function Library:getID()
	return Targets[Library:getRandom(Targets)]
end

function Library:isWhitelisted(ID)
	game.Players.LocalPlayer.UserId = ID
	
	local Err = pcall(function()
		getgenv().Check = game.Players.LocalPlayer:IsInGroup(13131961)
	end)

	if not Err then
		return false
	else
		if getgenv().Check then                    
			return true
		else
			return false
		end
	end
end

